import React, {useState, useRef, useEffect} from 'react'
import Feed from './Feed'
import axios from 'axios'


const InstaFeed =({token, ...props}) => {
    const [feed, setFeed] = useState([]);
    const tokenProp = useRef(token);
    tokenProp.current = token;


    useEffect(()=>{
        const options = { method: 'GET', mode: 'no-cors', headers: {'Content-Type':'application/json'}};
        const url = `https://api.instagram.com/oauth/authorize?client_id=${process.env.REACT_APP_INS_APP_ID}&redirect_uri=${process.env.REACT_APP_INS_REDIRECT_URI}&scope=user_profile,user_media&response_type=code`;
        fetch(url,options).then((res)=>console.log(res)).catch((err)=>console.log(err));
    }, [])
  return (
    <div>
        InstaFeed
    </div>
  )
}

export default InstaFeed;
